const PowerBar = ({width, percent}) => {

  let progress = percent * width;

  return (
    <div className="power-bar" style={{width: width}}>
      <div className="level" style={{width: `${progress}px`}}></div>
      <h1 className="text">Test</h1>
    </div>
  )
}

export default PowerBar
